import React from 'react'

const Week = () => {
  return (
    <div className='Weekbtn'>
     <button className='Weekbtn_Week1'>Week 1</button>
     <button className='Weekbtn_Week2'>Week 2</button>
     <button className='Weekbtn_Week3'>Week 3</button>
     <button className='Weekbtn_Week4'>Week 4</button>
    </div>
  )
}

export default Week
